import './App.css';
import { BrowserRouter, Route, Routes, Navigate, useParams } from 'react-router-dom';
import { useApi } from './hooks/use-api';
import {useState, useEffect} from 'react';
import { Link } from 'react-router-dom';
import './index.css';
import PatientPage from './PatientPage';
import Login from './Pages/Login';
import SignUp from './Pages/SignUp';
import './Pages/Login.css';
import axios from "axios";
import LoginForm from './Pages/Login';
import NavBar from "./NavBar";




function Effect(){
  const [data,setData] = useState([]);
  const [filteredResults, setFilteredResults] = useState([]);
  const [searchInput, setSearchInput] = useState('');
  const [newExam , setNewExam] = useState(false);
  const [examData, setExamData] = useState({}); 
  useEffect(() =>{
  axios
    .get("http://127.0.0.1:9000/exams")
    /*.get("https://czi-covid-lypkrzry4q-uc.a.run.app/api/exams")*/
    .then((response)=>{
      if(data !== response.data){
        setData(response.data);
      }
      })
  },[]); 


function saveExam(e){
  e.preventDefault()
  if(Object.keys(examData).length <4){
    //console.log(Object.keys(examData).length);
    alert(`fill in atleast 4 fields`);
  }else{
    fetch("http://localhost:9000/patient/insertExam",{
          method:"POST",
          crossDomain:true,
          headers:{
          "content-type":"application/json",
          Accept:"application/json",
          "Access-Control-Allow-Origin":"*",
          },
            body: JSON.stringify(examData),
          })

      setExamData({});
      setNewExam(false);
      console.log(examData);
      alert("Data sent to the api")
    }
}

  const searchItems = (searchValue) => { 
    setSearchInput(searchValue)
    if (searchInput !== '') {
        const filteredData = data.filter((exam) => {
            return Object.values(exam).join('').toLowerCase().includes(searchInput.toLowerCase())
        })
        setFilteredResults(filteredData)
    }
    else{
        setFilteredResults(data)
    }

}

  const NewExamButton=()=>{return(
          <button className="newExamButton" 
                  onClick={e=>{setNewExam(!newExam)}}> 
                  New Exam
          </button>)}
  return(
    <div>
      <div className="search">
        <input classname="searchField" type="text" placeholder="Search.." onChange={(e)=> searchItems(e.target.value)} title="Type in parameters"></input>
      </div>
      <table id='examTable'>
        <tr>
          <th>Patient ID</th>
          <th>Exam ID</th>
          <th>Image</th>
          <th>Key Findings</th>
          <th>ICU Admit</th>
